// List.jsx
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Boardlist = () => {
  const [posts, setPosts] = useState([]);



  return (
    <div>
      <h3>글 목록</h3>
      <ul>
        {posts.map(post => (
          <li key={post.id}>
            <h4>{post.title}</h4>
            <p>{post.content}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Boardlist;
